import React from 'react';
import '../styles/ProductsPage.css';
import CapabilitiesSection from '../components/CapabilitiesSection';
import backgroundImage from '../assets/deepmind.jpg'; // Importing the image directly

const ProductsPage = () => {
  return (
    <div className="products-page">
      {/* Hero Section */}
      <div
        className="hero-section"
        style={{
          backgroundImage: `url(${backgroundImage})`, // Use the imported image here
        }}
      >
        <div className="hero-overlay">
          <h1>Build a Company ... With a Single Prompt</h1>
          <p>Build remarkable GenAI applications fast, with lower cost, better performance, and greater ease of use at any scale.</p>
        </div>
      </div>

      {/* Capabilities Section */}
      <CapabilitiesSection />
    </div>
  );
};

export default ProductsPage;
